import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import Home from '../containers/desktop/index';

const routes = () => {
  console.log(Home);
  return (
    <Router>
      <Switch>
        <Route path="/" component={Home} />
      </Switch>
    </Router>
  );
};

export default routes;
